import Map from './Map'

function Main() {
    return (
        <div>
            <Map
                center={this.state.location}
                markers={this.state.venues}
                containerElement={<div style={{ height: `400px`, width: `100%` }} />}
                mapElement={<div style={{ height: `100%`, width: `100%` }} />}
            />
        </div>
    )
}

export default Main
